CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id"), "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "username" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "land_sabscriber" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sabscriber_name" varchar(200) NOT NULL, "sabscriber_email" varchar(254) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "orders_status" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status_name" varchar(32) NULL, "is_active" bool NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "orders_productinorder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_status" bool NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL, "order_id" integer NULL REFERENCES "orders_order" ("id"), "product_id" integer NULL REFERENCES "products_product" ("id"), "number" integer NULL, "price_all" decimal NOT NULL, "price_for_one" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "products_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(64) NULL, "description" text NULL, "is_active" bool NOT NULL, "comments" text NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL, "price" real NULL, "category_id" integer NULL REFERENCES "products_category" ("id"), "discount" integer NOT NULL, "discount_price" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "products_productimage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "is_active" bool NOT NULL, "image" varchar(100) NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL, "product_id" integer NULL REFERENCES "products_product" ("id"), "is_main" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "orders_productinbasket" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "session_key" varchar(128) NULL, "is_active" bool NOT NULL, "price_for_one" decimal NOT NULL, "number" integer NULL, "price_all" decimal NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL, "order_id" integer NULL REFERENCES "orders_order" ("id"), "product_id" integer NULL REFERENCES "products_product" ("id"));
CREATE TABLE IF NOT EXISTS "products_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category_name" varchar(64) NULL, "category_image" varchar(100) NOT NULL, "is_active" bool NOT NULL, "category_url" varchar(64) NULL);
CREATE TABLE IF NOT EXISTS "orders_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customer_name" varchar(100) NULL, "customer_email" varchar(254) NULL, "customer_number" varchar(100) NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL, "total_price" decimal NOT NULL, "status_id" integer NULL REFERENCES "orders_status" ("id"), "customer_address" varchar(100) NULL, "user_id" integer NULL REFERENCES "auth_user" ("id"));
CREATE TABLE IF NOT EXISTS "orders_statusdelivery" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status_delivery_name" varchar(32) NULL, "status" bool NOT NULL, "created" datetime NOT NULL, "updated" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "orders_deliveryinorder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "delivery_id" integer NULL REFERENCES "orders_delivery" ("id"), "order_id" integer NULL REFERENCES "orders_order" ("id"), "delivery_status_id" integer NULL REFERENCES "orders_statusdelivery" ("id"));
CREATE TABLE IF NOT EXISTS "orders_delivery" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created" datetime NOT NULL, "updated" datetime NOT NULL, "delivery_type" varchar(32) NULL, "status_delivery_type" bool NOT NULL, "price_for_delivery_type" integer NULL);
